      out.write("        <div class=\"option\">\r\n");
      out.write("            <div>\r\n");
      out.write("                <form onsubmit=\"searchPlaces(); return false;\">\r\n");
      out.write("                    키워드 : <input type=\"text\" value=\"성동구 동물 병원\" id=\"keyword\" size=\"15\"> \r\n");
      out.write("                    <input type=\"submit\" value=\"검색하기\"> \r\n");
      out.write("                </form>\r\n");
